function eventChatCommand(name,cmd,n)

    local c = { }
    string.gsub(cmd, "%S+", function(arg)
        c[#c + 1] = arg
    end)

if c[1] == "noportals" and conf.noportals == false then conf.noportals = true tfm.exec.chatMessage("<BV>The next maps will no longer have portals.") print("<BV>The next maps will no longer have portals.")
elseif c[1] == "noportals" and conf.noportals == true then conf.noportals = false tfm.exec.chatMessage("<BV>The next maps will now have portals.") print("<BV>The next maps will now have portals.") end
if c[1] == "flymode" and conf.flymode == false then conf.flymode = true tfm.exec.chatMessage("<BV>It is now possible to fly.") print("<BV>It is now possible to fly.")
elseif c[1] == "flymode" and conf.flymode == true then conf.flymode = false tfm.exec.chatMessage("<BV>It is no longer possible to fly.") print("<BV>It is no longer possible to fly.") end
if c[1] == "kill" then tfm.exec.killPlayer(c[2]) end
if c[1] == "pw" then 
	if c[2] then
		tfm.exec.setRoomPassword(c[2]) 
		tfm.exec.chatMessage("<BV>The room password is: <CH>"..tostring(c[2])) 
	else
		tfm.exec.setRoomPassword("") 		
		tfm.exec.chatMessage("<BV>The room's protection has been removed.") 
	end
end
if c[1] == "map" then tfm.exec.newGame(eval[tonumber(c[2])]) if c[2] == "random" then tfm.exec.newGame(eval[math.random(-2,36)]) end end
if c[1] == "choose" then catcher = players[math.random(#players)] tfm.exec.chatMessage("<BV>The catcher is: <CH>"..catcher) print("<BV>The catcher is: <CH>"..catcher) end
if c[1] == "map*" then tfm.exec.newGame(eval[tonumber(c[2])],true) if c[2] == "random" then tfm.exec.newGame(eval[math.random(-2,36)],true) end end
if c[1] == "atlas" then atlas(c[2]) end
if c[1] == "ls" and conf.debug then for k,v in next,_G[c[2]] do tfm.exec.chatMessage("<BV>"..tostring(k)..": <CH>"..tostring(v)) end end
if c[1] == "count" and conf.debug then tfm.exec.chatMessage("<BV>"..tostring(c[2])..": <CH>"..tostring(#_G[c[2]])) end
end

function gui(name)
ui.addTextArea(32, "<font size='10'><p align='center'>"..tostring(thismap).." <BL>|</BL> <J>no portals:<BL> "..tostring(conf.noportals).." <BL>|</BL> <J>mirrored map:<BL> "..tostring(tfm.get.room.mirroredMap).." |</BL> <J>able to fly:<BL> "..tostring(conf.flymode), name, 150, 380, 500, 27, 0x000022, 0x000022, 0.8, true)
ui.addTextArea(64, "<ROSE><a href='event:minimizePanel'><font size='10'>X</a>", nil, 640, 380, 20, 27, 0x000022, 0x000022, 0, true)
end

function rmgui(name)
ui.removeTextArea(32,name) 
ui.addTextArea(64, "<ROSE><p align='center'><a href='event:restorePanel'>+</a>", name, 6, 22, 12, 15, 0x000022, 0x000022, 0.8, true)
end

function eventNewPlayer(name)
tfm.exec.bindKeyboard(name,1,true,true)
tfm.exec.bindKeyboard(name,120,true,true)
end

function eventKeyboard(n, key, down, x, y)
	if key==1 and conf.flymode == true then tfm.exec.movePlayer(n,0,0,true,0,-17,true) end
	if key==120 then for k,v in pairs(tfm.get.room.objectList) do table.insert(objects,k) end tfm.exec.removeObject(objects[math.random(#objects)]) print("<R>*_*") end	
end

function eventNewGame()
	for k,v in next, tfm.get.room.playerList do
    players[k] = {}
	end
    local Ptag = string.match(tfm.get.room.xmlMapInfo.xml, "<P (.-)/>")
    local meta = string.match(Ptag, 'meta ?= ?"(.-)"')
    local mapName

    if meta then
        	mapName = string.gsub(meta, ",", "<BL> - $", 1).."</BL>" end
			thismap = string.gsub("<J>"..tostring(meta), ",", "<BL> - $", 1) print(thismap)

	    ui.setMapName(mapName)
	if Ptag:find('portal') and conf.noportals == false then
		for value in Ptag:gmatch('portal="(.+)"') do
			print(value)            
			tfm.exec.addShamanObject(26,tonumber(value:match('(.-);'):match('(.-),')),tonumber(value:match('(.-);'):match(',(.+)')),0,0,0,false)
			tfm.exec.addShamanObject(27,tonumber(value:match(';(.+)'):match('(.-),')),tonumber(value:match(';(.+)'):match(',(.+)')),0,0,0,false)    
		end
	end
	gui()
end

ICR = {}
function atlas(page,targ)
	page=page or 1
	rmgui(targ)
	for i=0,14 do ui.removeTextArea(i,targ) end
	ui.addTextArea(-1,"",targ,-5000,-5000,10000,10000,0x000022,0x000022,0.8,true)
	ui.addTextArea(65,"<font size='10'><p align='center'><font size='3'> </font>\n<a href='event:page ".. page-1 .."'><font face='Webdings'>3</font>previous</a> <a href='event:cls'>close</a> <a href='event:page ".. page+1 .."'>next<font face='Webdings'>4</font></a></p></font>",targ,5,10,790,32,0x000022,0x000022,1,true)
	for k,v in next,ICR do tfm.exec.removeImage(v) end
	for i=0+(page-1)*15,(page-1)*15+14 do
		if info[i] then
			ui.addTextArea(i%15,"<font size='16'><b><p align='center'><ROSE>Map "..i.."</ROSE></p></b></font>",targ,(i%5)*160+5,(math.ceil((((i-(page*15))+1)/5))*118)+285,155,23,0x000022,0x000022,0,true)
			ICR[#ICR+1] = tfm.exec.addImage(info[i].i,"&"..i,(i%5)*160,(math.ceil((((i-(page*15))+1)/5))*118)+310,targ)
			if conf.debug then tfm.exec.chatMessage("<CH2>Loaded image "..i.."<G>: "..tostring(info[i].i).." "..tostring((i%5)*160).." "..tostring((math.ceil((((i-(page*15))+1)/5))*118)+310).." "..tostring(i%5)) end
		end
	end
end

function eventTextAreaCallback(id, name, callback)
    local c = { }
    string.gsub(callback, "%S+", function(arg)
        c[#c + 1] = arg
    end)
	if callback=="minimizePanel" then rmgui(name) end
	if callback=="restorePanel" then gui(name) end
	if c[1]=="page" then atlas(c[2],c[3] or name) end
	if c[1]=="cls" then 
		for i=-1,14 do ui.removeTextArea(i,name) end
		ui.removeTextArea(65,name)
		for k,v in next,ICR do tfm.exec.removeImage(v) end
		gui(name)
	end
end

